import AVFoundation
import SwiftUI

// MARK: - LeaderboardEntryDetailView

struct LeaderboardEntryDetailView: View {
    var position: Int
    var entry: Leaderboard.Entry

    @Environment(\.dismiss) private var dismiss
    
    var body: some View {
        VStack {
            Text("#1 by \(entry.username)")
                .frame(maxWidth: .infinity, alignment: .leading)
                .font(.system(.largeTitle, weight: .bold))
            Spacer()

            Text("Summary: ")
                .frame(maxWidth: .infinity, alignment: .leading)
                .font(.system(.title2, weight: .bold))
            
            VStack(alignment: .leading) {
                HStack {
                    Text("First shot delay:")
                        .fontWeight(.medium)
                    Text(entry.firstShotDelay.secondMS)
                }
                HStack {
                    Text("Shots split:")
                        .fontWeight(.medium)
                    Text(entry.shotsSplit.secondMS)
                }
                HStack {
                    Text("Total time:")
                        .fontWeight(.medium)
                    Text(entry.totalTime.secondMS)
                }
            }
            .padding()
            .frame(maxWidth: .infinity, alignment: .leading)
            .background(
                RoundedRectangle(cornerRadius: 8)
                    .foregroundStyle(Color.gray.opacity(0.2))
            )
            
            Spacer()
                .frame(height: 32)
            
            Text("Recording: ")
                .frame(maxWidth: .infinity, alignment: .leading)
                .font(.system(.title2, weight: .bold))
            AudioView(audioData: entry.recordingData)
            
            Spacer()
            
            Button(action: {
                dismiss()
            }, label: {
                Text("Dismiss")
                    .padding()
                    .frame(maxWidth: .infinity)
            })
            .buttonStyle(.borderedProminent)
        }
        .padding(.horizontal)
    }
}

private extension TimeInterval {
    var secondMS: String {
        String(format:"%02d.%03d", second, millisecond)
    }
}

